import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Articles from './data.js';

import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

import { Button, Nav, Navbar } from 'react-bootstrap';

import Stack_card from './components/Stack_card.js';



function App() {
  return (
    <Container className='p-0 bg_main' fluid>

      <Row className='g-0'>

        <Col className='p-0 border border-dark' xs={2} > </Col>

        <Col>

          <Container className='p-0 ' fluid>

            <Navbar bg="py-3" data-bs-theme="light">
              <Container clasName="border-bottom" fluid="xxl" >
                <Navbar.Brand className='fs-1 fw-bold' href="#home">NewsBoard</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                  <Nav className="me-auto">
                    <Nav.Link className='fs-5' href="#home">Home</Nav.Link>
                    <Nav.Link className='fs-5' href="#link">Link</Nav.Link>
                  </Nav>
                </Navbar.Collapse>
              </Container>
            </Navbar>

            <Container className='h-75' fluid="xxl" >

              <h1 className='dark pt-5 text-center fw-bold'>
                Latest News
              </h1>

              <Col className='h-100 py-4' >



                <Row xs={1} md={3} className='g-5' >

                  {Array.from({ length: 3 }).map((_, idx) => (
                    <Col key={idx}>
                      <Stack_card articles={Articles} i_line={idx} />
                    </Col>
                  )
                  )}

                </Row>

              </Col>

            </Container>

          </Container >

        </Col>

      </Row>

    </Container>

  );
}

export default App;
